		return STATUS_UNSUCCESSFUL;

	PEPROCESS process = 0;
	if (udman_spoof(PsLookupProcessByProcessId)( (HANDLE)ControlRegister->process_id, &process ) != STATUS_SUCCESS )
	{
		return STATUS_UNSUCCESSFUL;
	}

	struc::SavedCr3 = dirbase_from_base_address( ( void* ) udman_spoof(PsGetProcessSectionBaseAddress)( process ) ) ;

	ObfDereferenceObject( process );


	return STATUS_SUCCESS;
